// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "./SyndicateClosedEndFundLogic.sol";

/// @author Syndicate Inc.
/// @notice Handle transferring member deposits between addresses
contract SyndicateClosedEndFundDepositTransferLogicV0 is
    SyndicateClosedEndFundLogic
{
    // Storage------------------------------------------------------------------

    /// @notice Used to initialize the Syndicate contract.
    constructor(address storeAddress)
        SyndicateClosedEndFundLogic(storeAddress)
    {}

    // Events-------------------------------------------------------------------

    /// @notice Emit an event when a manager alters transferability
    event managerSetterTransferable(
        address indexed syndicateAddress,
        bool transferable,
        uint256 timestamp
    );

    /// @notice Emit an event when a manager transfers a deposit portion from
    /// a member to another address.
    /// @dev A different event is emitted for member-initiated transfers
    event managerTransferredDeposit(
        address indexed syndicateAddress,
        address indexed memberAddress,
        address indexed targetAddress,
        uint256 amount,
        uint256 timestamp
    );

    /// @notice Emit an event when a member transfers a deposit portion from
    /// a member to another address.
    /// @dev A different event is emitted for manager-initiated transfers
    event memberTransferredDeposit(
        address indexed syndicateAddress,
        address indexed memberAddress,
        address indexed targetAddress,
        uint256 amount,
        uint256 timestamp
    );

    // Functions----------------------------------------------------------------

    /// @notice Used by a manager to change the transferability of a Syndicate.
    /// @param syndicateAddress The address of the Syndicate
    /// @param transferable The new value of transferability
    function managerSetTransferable(address syndicateAddress, bool transferable)
        public
        onlyManager(syndicateAddress)
        onlyModifiable(syndicateAddress)
    {
        store.setTransferable(syndicateAddress, transferable);

        emit managerSetterTransferable(
            syndicateAddress,
            transferable,
            block.timestamp
        );
    }

    /// @notice Manager transfer portion of member's deposit to another address.
    /// @param syndicateAddress Address of the Syndicate
    /// @param memberAddress Address of member to transfer deposits **from**
    /// @param targetAddress Address to transfer deposits **to**
    /// @param amount Amount to transfer between member and target
    function managerTransferDepositForMembers(
        address syndicateAddress,
        address memberAddress,
        address targetAddress,
        uint256 amount
    )
        public
        onlyManager(syndicateAddress)
        onlyBeforeDistributing(syndicateAddress)
        onlyModifiable(syndicateAddress)
    {
        // if target is not on allowlist yet, add them before transferring
        if (
            store.allowlistEnabled(syndicateAddress) &&
            !store.addressAllowed(syndicateAddress, targetAddress)
        ) {
            store.setAddressAllowed(syndicateAddress, targetAddress, true);
        }

        _transferDeposit(
            syndicateAddress,
            memberAddress,
            targetAddress,
            amount
        );

        emit managerTransferredDeposit(
            syndicateAddress,
            memberAddress,
            targetAddress,
            amount,
            block.timestamp
        );
    }

    /// @notice Member transfer portion of deposit to another address.
    /// @param syndicateAddress Address of the Syndicate
    /// @param targetAddress Address to transfer deposits to
    /// @param amount Amount of deposit to transfer to targetAddress
    function memberTransfer(
        address syndicateAddress,
        address targetAddress,
        uint256 amount
    )
        public
        onlyNotManager(syndicateAddress)
        onlyTransferable(syndicateAddress)
        onlyBeforeDistributing(syndicateAddress)
    {
        _transferDeposit(syndicateAddress, msg.sender, targetAddress, amount);

        emit memberTransferredDeposit(
            syndicateAddress,
            msg.sender,
            targetAddress,
            amount,
            block.timestamp
        );
    }

    /// @notice Transfers deposits from one address to another.
    /// @param syndicateAddress The address of the Syndicate
    /// @param originAddress The address to transfer deposits **from**
    /// @param targetAddress The address to transfer deposits **to**
    /// @param amount Amount to transfer between origin and target
    /// @notice Because this internal function can be called by both a member
    /// and a manager, we leave the event emmission responsibility in their
    /// respective public functions.
    function _transferDeposit(
        address syndicateAddress,
        address originAddress,
        address targetAddress,
        uint256 amount
    ) internal whenNotPaused() {
        // prevent empty transfers
        require(amount > 0, "TFR<=0");

        // require target to be on allowlist (if enabled)
        if (store.allowlistEnabled(syndicateAddress)) {
            require(store.addressAllowed(syndicateAddress, targetAddress), "MBR_NOT_ALLOWED");
        }

        uint256 oldOriginDeposit = store.depositMember(
            syndicateAddress,
            originAddress
        );

        // prevent overdraft transfers
        require(amount <= oldOriginDeposit, "TFR>BAL");

        if (amount == oldOriginDeposit) {
            // completely draining existing member address, removing them as a
            // member of this Syndicate
            store.setNumMembersCurrent(
                syndicateAddress,
                store.numMembersCurrent(syndicateAddress) - 1
            );
        } else {
            // prevent remaining deposit below depositMinMember
            require(
                oldOriginDeposit - amount >=
                    store.depositMinMember(syndicateAddress),
                "0<BAL<MIN_MBR_DEP"
            );
        }

        uint256 oldTargetDeposit = store.depositMember(
            syndicateAddress,
            targetAddress
        );

        if (oldTargetDeposit == 0) {
            // target address was not previously a member, now adding them
            // to this Syndicate
            store.setNumMembersCurrent(
                syndicateAddress,
                store.numMembersCurrent(syndicateAddress) + 1
            );

            // prevent target address' deposit below depositMinMember
            require(
                oldTargetDeposit + amount >=
                    store.depositMinMember(syndicateAddress),
                "0<BAL<MIN_MBR_DEP"
            );
        } else {
            // prevent target address' deposit above depositMaxMember
            // only risk of violation if targetAddress has an existing deposit
            require(
                oldTargetDeposit + amount <=
                    store.depositMaxMember(syndicateAddress),
                "BAL>MAX_MBR_DEP"
            );
        }

        // prevent member count from exceeding numMembersMax
        // only risk of violation is if we partially transfer to a new address,
        // therefore incrementing numMembersCurrent by 1 from previous value
        require(
            store.numMembersCurrent(syndicateAddress) <=
                store.numMembersMax(syndicateAddress),
            "MAX_MBRS_REACHED"
        );

        // decrease origin address deposit holdings
        store.setDepositMember(
            syndicateAddress,
            originAddress,
            store.depositMember(syndicateAddress, originAddress) - amount
        );

        // increase target address deposit holdings
        store.setDepositMember(
            syndicateAddress,
            targetAddress,
            store.depositMember(syndicateAddress, targetAddress) + amount
        );

        // check oldOriginDeposit - amount = originAddress's holdings
        _checkBookkeeping(
            oldOriginDeposit,
            amount,
            store.depositMember(syndicateAddress, originAddress),
            false
        );

        // check oldTargetDeposit + amount = targetAddress's holdings
        _checkBookkeeping(
            oldTargetDeposit,
            amount,
            store.depositMember(syndicateAddress, targetAddress),
            true
        );
    }
}

